function playAnimation() {
  anim.setDirection(1);
  anim.play();
  setTimeout(function(){
    anim.pause();
  },830);
}

function playAnimationReverse() {
  anim.setDirection(-1);
  anim.play();
  setTimeout(function(){
    anim.pause();
  },830);
}